La Chasse (Tony Del Duomo, Marc Dorcel / DvdRip / 2005) 

Disguised as a hunting game, a group of young men organize a glorious orgy for themselves with young and beautiful girls. In this game the rules are quite simple... The girls are the prey and their bodies are the prize.

Oksana D'Harcourt, Priscilla Salermo, Baby Marilyn, Claudia Rossi, Tera Bond, Jessica Fiorentino, Omar Galanti, Franco Trentalance, Horst Baron, Tony Carrera, Marco Nero, Robert Lion

Feature, Anal, Lesbo

